"use strict";

function f_gold(aliceSizes, bobSizes) {
    let diff = (aliceSizes.reduce((a, b) => a + b) - bobSizes.reduce((a, b) => a + b)) >> 1;
    let s = new Set(bobSizes);
    for (let a of aliceSizes) {
        let target = a - diff;
        if (s.has(target)) {
            return [a, target];
        }
    }
}
